INSERT INTO `habitat` (`habitat_id`, `nom`, `description`, `commentaire_habitat`) VALUES
(1, 'Savane Africaine', 'Les vastes espaces des savanes du monde se trouvent principalement dans les rÃ©gions tropicales du globe. Le mot savane vient du mot du XVIe siÃ¨cle zavanna, qui signifie Â« plaine sans arbres Â». Cependant, le terme est utilisÃ© pour dÃ©crire un habitat plus variÃ©, composÃ© de grandes Ã©tendues de graminÃ©es, souvent d\'un ou deux types qui crÃ©ent un tapis continu, interrompu par des arbustes et des arbres Ã©pars.\r\n            Les savanes apparaissent lÃ  oÃ¹ il n\'y a pas assez de pluie pour soutenir une forÃªt tropicale, mais suffisamment pour Ã©viter qu\'elle ne devienne un dÃ©sert. Il y a gÃ©nÃ©ralement une saison sÃ¨che et une saison des pluies dans la savane, avec des vents forts et chauds pendant la saison sÃ¨che et suffisamment de pluie pendant la saison humide pour inonder les zones basses. Quelques exemples d\'habitats de savane sont les plaines d\'Afrique de l\'Est, les pampas d\'AmÃ©rique du Sud et les forÃªts ouvertes du nord de l\'Australie\r\n            La savane abrite de grands troupeaux de faune herbivore et les prÃ©dateurs qui les suivent. C\'est un Ã©cosystÃ¨me soigneusement Ã©quilibrÃ© qui peut facilement Ãªtre perturbÃ© par les changements climatiques, un dÃ©sÃ©quilibre dans le nombre et le type de faune, et les influences humaines telles que l\'agriculture et l\'Ã©levage de bÃ©tail. Le feu joue Ã©galement un rÃ´le important dans la savane, brÃ»lant les anciennes herbes et les nouveaux semis d\'arbres, laissant place aux nouvelles herbes dont dÃ©pendent les herbivores comme les gazelles.', 'ras'),
(2, 'ForÃªt Tropicale', 'Les forÃªts tropicales humides sont des Ã©cosystÃ¨mes luxuriants situÃ©s autour de l\'Ã©quateur, couvrant moins de 6 % de la surface terrestre mais abritant plus de 50 % des espÃ¨ces vÃ©gÃ©tales et animales du monde. Elles reÃ§oivent plus de 60 pouces de pluie par an et ont une tempÃ©rature constante entre 20 et 28 degrÃ©s Celsius. Ces forÃªts sont vitales pour la biodiversitÃ© et la recherche scientifique, avec des espÃ¨ces encore inconnues et des plantes possÃ©dant des propriÃ©tÃ©s mÃ©dicinales, comme la pervenche utilisÃ©e contre la leucÃ©mie infantile.\r\n\r\nChaque jour, nous consommons des produits issus de ces forÃªts, comme les bananes, le chocolat, et le riz. Cependant, les forÃªts tropicales sont menacÃ©es par la dÃ©forestation due aux incendies, Ã  l\'exploitation forestiÃ¨re, et aux pratiques agricoles destructrices. Il est crucial de trouver des moyens durables de rÃ©colter leurs ressources pour prÃ©server ces trÃ©sors biologiques pour l\'avenir.', ''),
(3, 'Ãle', 'Ce que tous les Ã©cosystÃ¨mes insulaires ont en commun, c\'est qu\'ils sont isolÃ©s du continent et qu\'ils crÃ©ent des environnements spÃ©ciaux, voire uniques, avec des espÃ¨ces animales et vÃ©gÃ©tales qui peuvent Ãªtre trÃ¨s diffÃ©rentes de leurs homologues continentaux. En fait, certaines espÃ¨ces ne se trouvent que sur les Ã®les parce qu\'elles se sont dÃ©veloppÃ©es de maniÃ¨re indÃ©pendante, comme le kiwi de Nouvelle-ZÃ©lande et la tortue des GalÃ¡pagos des Ã®les GalÃ¡pagos. Parce qu\'ils sont limitÃ©s en taille et en ressources, les Ã©cosystÃ¨mes insulaires sont fragiles et facilement perturbÃ©s par les espÃ¨ces introduites et l\'activitÃ© humaine. Les animaux insulaires peuvent rapidement devenir en danger si leur habitat est dÃ©truit ou si leur nourriture disparaÃ®t, car ils n\'ont nulle part ailleurs oÃ¹ aller.', ''),
(4, 'Prairies Rocheuses', 'Les prairies d\'AmÃ©rique du Nord et du Sud ainsi que les steppes d\'Asie et d\'Australie sont des habitats de prairies qui, contrairement Ã  la savane, subissent de plus grands changements de saison et de tempÃ©rature : chaud en Ã©tÃ© et froid en hiver. Aussi appelÃ©s prairies tempÃ©rÃ©es, ces habitats ont Ã©voluÃ© pendant des milliers d\'annÃ©es pour rÃ©sister au vent, aux tempÃªtes, aux pluies torrentielles, aux incendies et au pÃ¢turage par de grands animaux. Une prairie a gÃ©nÃ©ralement des herbes plus hautes qu\'une steppe; certaines parties de la prairie sÃ¨che Ã  herbe courte des Grandes Plaines d\'AmÃ©rique du Nord sont Ã©galement appelÃ©es steppes.Il y a une Ã©norme diversitÃ© de vie vÃ©gÃ©tale, avec des centaines d\'espÃ¨ces de graminÃ©es, d\'herbes, de mousses et d\'autres plantes dans les prairies et les steppes. Les graminÃ©es ont des racines solides, des tiges flexibles capables de stocker des nutriments et divers degrÃ©s de tolÃ©rance Ã  la sÃ©cheresse. Ces graminÃ©es maintiennent le fonctionnement de la prairie : lorsqu\'une zone est trop pÃ¢turÃ©e ou cultivÃ©e de maniÃ¨re intensive pendant trop longtemps, les graminÃ©es disparaissent et la couche arable est vulnÃ©rable Ã  l\'Ã©rosion et peut Ãªtre emportÃ©e par le vent. Il y a aussi des ruisseaux et des cours d\'eau qui traversent ces prairies, soutenant les arbres, et des affleurements rocheux qui offrent un abri Ã  la faune.\r\n            MÃªme si la prairie peut sembler dÃ©solÃ©e, c\'est en rÃ©alitÃ© un habitat fertile et diversifiÃ© qui a Ã©tÃ© connu pour abriter 80 espÃ¨ces diffÃ©rentes de mammifÃ¨res et plus de 300 espÃ¨ces d\'oiseaux dans certains endroits.', 'ras'),
(5, 'DÃ©sert', 'Les dÃ©serts sont des endroits chauds et secs composÃ©s principalement de sable, de roches et de montagnes. En gÃ©nÃ©ral, les dÃ©serts sont dÃ©finis comme des zones oÃ¹ la quantitÃ© d\'eau qui s\'Ã©vapore dans l\'air est supÃ©rieure Ã  la quantitÃ© qui tombe au sol sous forme de pluie.\r\n            Dans le dÃ©sert, les tempÃ©ratures peuvent atteindre jusqu\'Ã  120 degrÃ©s Fahrenheit (50 degrÃ©s Celsius) dans certaines rÃ©gions ; mais comme il n\'y a pas de couverture nuageuse pour retenir la chaleur, les dÃ©serts peuvent aussi devenir trÃ¨s froids la nuit, avec des tempÃ©ratures plongeant jusqu\'Ã  â€“4 degrÃ©s Fahrenheit (â€“20 degrÃ©s Celsius) Ã  certains endroits. Les dÃ©serts peuvent Ã©galement Ãªtre trÃ¨s venteux, ce qui peut provoquer de violentes tempÃªtes de sable. Des exemples de dÃ©serts sont les dÃ©serts du Namib et du Kalahari en Afrique, le dÃ©sert d\'Arabie sur la pÃ©ninsule arabique, le Grand DÃ©sert de Victoria en Australie, et les dÃ©serts de Mojave et de Sonora aux Ã‰tats-Unis.\r\n            MÃªme dans ces conditions rigoureuses et inhospitaliÃ¨res, peu de dÃ©serts sont complÃ¨tement stÃ©riles. Il y a des plantes et des animaux qui se sont adaptÃ©s pour survivre dans cet habitat. Les plantes ont souvent des feuilles fines et rÃ©sistantes ou des tiges succulentes (comme les cactus) pour stocker l\'eau, et certaines restent dormantes pendant les pÃ©riodes sÃ¨ches, ne prenant vie que lorsqu\'une des rares averses survient. Les animaux survivent dans les dÃ©serts en vivant sous terre ou en se reposant dans des terriers pendant la chaleur de la journÃ©e. Certaines crÃ©atures obtiennent l\'humiditÃ© dont elles ont besoin Ã  partir de leur nourriture, donc elles n\'ont pas besoin de boire beaucoup d\'eau, voire pas du tout. D\'autres vivent aux abords des dÃ©serts, oÃ¹ il y a plus de plantes et d\'abris.  ', ''),
(6, 'Foret TempÃ©rÃ©e', 'Dans les forÃªts tempÃ©rÃ©es, les prÃ©cipitations sont suffisantes pour permettre aux arbres, arbustes, fleurs, fougÃ¨res et mousses de prospÃ©rer, tout en suivant le rythme des saisons : soleil et tempÃ©ratures chaudes en Ã©tÃ©, et neige et tempÃ©ratures froides en hiver. La plupart des forÃªts tempÃ©rÃ©es sont constituÃ©es d\'un mÃ©lange d\'arbres Ã  feuilles caduques comme le chÃªne, le hÃªtre, l\'Ã©rable, le frÃªne, le noisetier et le bouleau, ainsi que de quelques conifÃ¨res et rÃ©sineux comme le pin, le sÃ©quoia, l\'Ã©pinette et le cÃ¨dre.\r\n            La taÃ¯ga est un type d\'habitat forestier parfois appelÃ© forÃªt borÃ©ale, mais elle est beaucoup plus froide et peut rester sous la glace et la neige pendant plus de six mois par an. Les arbres de cette forÃªt sont principalement des conifÃ¨res et des rÃ©sineux, comme l\'Ã©picÃ©a, le pin, le sapin et le mÃ©lÃ¨ze.\r\n            Certaines zones de forÃªt tempÃ©rÃ©e possÃ¨dent des peuplements d\'arbres trÃ¨s anciens, tandis que d\'autres zones, affectÃ©es par des tempÃªtes, des sÃ©cheresses, des glissements de terrain ou des incendies, contiennent des arbres plus jeunes et des espaces plus ouverts comme des clairiÃ¨res ou de petites prairies. TrÃ¨s peu des forÃªts tempÃ©rÃ©es de la Terre ont Ã©tÃ© laissÃ©es intactes par l\'homme, et d\'immenses zones autrefois couvertes de forÃªts anciennes, dites Â« forÃªts primaires Â», sont maintenant occupÃ©es par des villes et des terres agricoles.\r\n            Les interactions entre les arbres, les arbustes et le sous-bois des forÃªts tempÃ©rÃ©es et de la taÃ¯ga sont complexes et dynamiques, car ils rÃ©agissent aux changements dans le sol, l\'eau, les saisons et le climat. Cela crÃ©e un Ã©cosystÃ¨me diversifiÃ© contenant plusieurs types de communautÃ©s forestiÃ¨res. Le sol riche, les litiÃ¨res de feuilles, les arbres tombÃ©s et la forÃªt vivante fournissent des habitats et des sources de nourriture pour une grande variÃ©tÃ© d\'animaux et d\'insectes.', '');

